import React from "react";
import MainCSS from '../styles/Main.module.css'

export default function Card({ nameTest, elem, url, userName }) {
    function x(y = {}) {
        let keys = Object.keys(y)

        let i = 0
        for (let key of keys) {
            if (key.split('_')[1] === 'type') {
                i += 1
            }
        }

        return i
    }

    return (<>
        <a href={`/resolution/${url}`} className={MainCSS.main_item}>

            <div className={MainCSS.main_item__title}>{nameTest}</div>
            <div className={MainCSS.main_item__footer}>
                <p className={MainCSS.footer_autor}>{userName}</p>
                <p className={MainCSS.footer_countQues}>Ð’: {x(elem)}</p>
            </div>

        </a>
    </>)
}
